Master_Details_Table_1.query:
--"CG_Visit"
--Get Total Number of Visits (# Visits, Avg # Visits per Day, % Successful Visits)
Visit = load "${App.Datasets.CG_Visit5_tp.FullyQualifiedName}";
Visit_A = filter Visit by 'Status' in ["Completed","Abandonded"];
Visit_B = filter Visit by 'Status' == "Completed";
Visit_C = filter Visit by 'ActualVisitEndTime_sec_epoch' is not null;
Visit_result = group Visit_A by 'Visitor_UniqueUserName' full, Visit_B by 'Visitor_UniqueUserName' full, Visit_C by 'Visitor_UniqueUserName';
Visit_result = foreach Visit_result generate  Visit_C.'Visitor_UniqueUserName' as 'Visitor_UniqueUserName',  first(Visit_C.'Visitor_SmallPhotoUrl') as 'Rep_Pic', count(Visit_B)/count(Visit_A) as 'Percent_of_Successful_visits',  count(Visit_B) as 'Number_of_Completed_Visits',  count(Visit_A) as 'Total_Number_of_Completed_n_Abandonded', count(Visit_C) as 'Number_of_Visits', unique(Visit_C.'ActualVisitStartTime_YearMonthDay') as 'unique_ActualVisitStartTime_YearMonthDay', count(Visit_C) / unique(Visit_C.'ActualVisitStartTime_YearMonthDay') as 'avg_Number_of_Visits_per_Day';

--CG_OrderItem 
--Total Quantity of Products, Total_Sales,number of Products sold
CG_OrderItem = load "${App.Datasets.CG_OrderItem5_tp.FullyQualifiedName}";
CG_OrderItem = group CG_OrderItem by 'Order_AssessmentTaskOrder_AssessmentTask_ActionPlanItem_ActionPlan_Visit_Visitor_UniqueUserName';
CG_OrderItem = foreach CG_OrderItem generate  'Order_AssessmentTaskOrder_AssessmentTask_ActionPlanItem_ActionPlan_Visit_Visitor_UniqueUserName' as 'Rep_Name', sum('TotalPrice') as 'Total_Sales', sum('Quantity') as 'Total_Quantity_of_Products', unique('Product2Id') as 'Number_of_Products_Owned';

--CG_RetailVisitKpi 
--Percent_Tasks_Completed
q = load "${App.Datasets.CG_RetailVisitKpi5_tp.FullyQualifiedName}";
q = group q by ('AssessmentTask_ActionPlanItem_ActionPlan_Visit_Visitor_UniqueUserName');
result = foreach q generate 'AssessmentTask_ActionPlanItem_ActionPlan_Visit_Visitor_UniqueUserName' as 'Rep_Name', sum('Completed_Tasks_Count') / count() as 'Percent_Tasks_Completed';

--Average Share of Shelf 
sos = load "${App.Datasets.CG_RetailVisitKpi5_tp.FullyQualifiedName}";
sos = filter sos by 'Include_In_Compliance' == "True";
sos = filter sos by 'Type_Computed' == "ShareOfShelf";
sos = group sos by ('AssessmentTask_ActionPlanItem_ActionPlan_Visit_Visitor_UniqueUserName', 'AssessmentTask_ActionPlanItem_ActionPlan_Visit_RetailStore_Name');
sos = foreach sos generate 'AssessmentTask_ActionPlanItem_ActionPlan_Visit_Visitor_UniqueUserName' as 'Rep_Name', 'AssessmentTask_ActionPlanItem_ActionPlan_Visit_RetailStore_Name' as 'Store_Name', avg(Compliance_Percentage) as 'avg_SoS_Compliance_Percentage';
sos = group sos by 'Rep_Name';
sos = foreach sos generate 'Rep_Name', avg('avg_SoS_Compliance_Percentage') as 'avg_SoS_Compliance_Percentage';

--CG_RetailVisitKpi
--Out_of_Stock_cases
ofs = load "${App.Datasets.CG_RetailVisitKpi5_tp.FullyQualifiedName}";
ofs = filter ofs by 'AssessmentIndicatorDefinition_DataType' == "Boolean";
ofs = filter ofs by 'Type_Computed' == "OutOfStock";
ofs = filter ofs by 'ActualBooleanValue' == "True";
ofs = group ofs by 'AssessmentTask_ActionPlanItem_ActionPlan_Visit_Visitor_UniqueUserName';
ofs = foreach ofs generate ofs.'AssessmentTask_ActionPlanItem_ActionPlan_Visit_Visitor_UniqueUserName' as 'Rep_Name', count(ofs) as 'Out_of_Stock_cases';

--CG_RetailVisitKpi
--Compliance average 
comp = load "${App.Datasets.CG_RetailVisitKpi5_tp.FullyQualifiedName}";
comp = filter comp by 'Include_In_Compliance' == "True";
comp_result = group comp by ('AssessmentTask_ActionPlanItem_ActionPlan_Visit_Visitor_UniqueUserName','AssessmentTask_ActionPlanItem_ActionPlan_Visit_RetailStore_Name');
comp_result = foreach comp_result generate 'AssessmentTask_ActionPlanItem_ActionPlan_Visit_Visitor_UniqueUserName' as 'Rep_Name', 'AssessmentTask_ActionPlanItem_ActionPlan_Visit_RetailStore_Name' as 'Store_Name', avg('Compliance_Percentage') as 'Avg_Compliance_Percentage';
comp_result = group comp_result by 'Rep_Name';
comp_result = foreach comp_result generate 'Rep_Name' as 'Rep_Name', avg('Avg_Compliance_Percentage') as 'Avg_Compliance_Percentage_Current';

--final table 
final_table = cogroup Visit_result by 'Visitor_UniqueUserName' full, CG_OrderItem by 'Rep_Name' full, sos by 'Rep_Name' full, result by 'Rep_Name' full, ofs by 'Rep_Name' full, comp_result by 'Rep_Name';
final_table = foreach final_table generate 
coalesce(Visit_result.'Visitor_UniqueUserName', CG_OrderItem.'Rep_Name',sos.'Rep_Name', result.'Rep_Name', ofs.'Rep_Name', comp_result.'Rep_Name') as 'Visitor_UniqueUserName', 
sum(CG_OrderItem.'Total_Quantity_of_Products') as 'Total_Quantity_of_Products', 
sum(CG_OrderItem.'Total_Sales') as 'Total_Sales', 
avg(sos.'avg_SoS_Compliance_Percentage') as 'avg_SoS_Compliance_Percentage', 
sum(CG_OrderItem.'Number_of_Products_Owned') as 'Total_Num_Products_Sold', 
avg(comp_result.'Avg_Compliance_Percentage_Current') as 'Avg_Compliance_Percentage',
sum(ofs.'Out_of_Stock_cases') as 'Out_of_Stock_cases',
sum(Visit_result.'Number_of_Visits') as 'Total_Num_Visits', 
avg(Visit_result.'avg_Number_of_Visits_per_Day') as 'avg_Number_of_Visits_per_Day',
sum(Visit_result.'Percent_of_Successful_visits') as 'Percent_Successful_Visits', 
sum(result.'Percent_Tasks_Completed') as 'Percent_Tasks_Completed', 
sum(CG_OrderItem.'Total_Sales')/sum(Visit_result.'Number_of_Visits') as 'avg_Order_Value_per_Visit';

